import React, { memo } from "react";

const Songs = ({ thumbnail, artistsNames, releaseDate, title }) => {
  return (
    <div className="w-[31%] flex border border-red-700 items-center p-[10px] text-white">
      <div className="flex gap-3 items-center">
      <img
          src={thumbnail}
          alt="thumbnailM"
          className="h-[60px] w-[60px] object-contain"
        />
      
      <div className="flex flex-col">
      <span className="text-sm font-medium">{title}</span>
        <span className="text-xs truncate">{artistsNames}</span>
        <span className="text-xs" >releaseDate</span>
      </div>
      </div>
    </div>
  );
};

export default memo(Songs);
